import { Card } from "react-bootstrap";


const Note =(props)=> {
    //const { id, title_, content } = props;

    return(
        <Card key={props.key}>
            <Card.title>{props.title_}</Card.title>
            <Card.Body>{props.content}</Card.Body>
        </Card>
    );
}

export default Note;
